import React from 'react'
import styles from './Header.module.css'
import { HeartOutlined, LockOutlined, ShoppingOutlined, UserOutlined } from '@ant-design/icons';
import { Button, Dropdown, Space } from "antd";
import Search from "antd/es/input/Search";
export default function Header() {
  return (
    <div>
      <div className={styles.Navbar}>
        <div className={styles.First_Navbar}>
          <div className={styles.Item}><UserOutlined />Tài khoản của tôi</div>
          <div className={styles.Item}><HeartOutlined />Danh sách yêu thích</div>
          <div className={styles.Item}><ShoppingOutlined />Thanh toán</div>
          <div className={styles.Item}><LockOutlined />Đăng nhập</div>
        </div>
        <div className={styles.Navbar_mid}>
          <div style={{ width: "175px" }}>
            <img style={{ maxWidth: "100%" }} src={''} alt="logo" />
          </div>

          <div>
            <Search
              placeholder="Tìm kiếm tại đây..."
              allowClear
              bordered={true}
              // enterButton={<button style={{ border: 'none' }}>search</button>}
              enterButton={
                <Button
                  type="submit"
                  style={{
                    border: "none",
                    backgroundColor: "transparent",
                    height: "38px",
                  }}
                >
                  <SearchOutlined style={{ fontSize: "18px" }} />
                </Button>
              }
              style={{
                width: "420px",
                marginLeft: "-20px",
                border: "none",
                height: "35px",
                backgroundColor: "transparent",
              }}
            />
          </div>

          <div
            style={{
              display: "flex",
              alignItems: "center",
              justifyContent: "space-between",
              width: 200,
            }}
          >
            <div>
              <PhoneOutlined
                style={{
                  border: "2px solid yellow",
                  borderRadius: "50%",
                  padding: "10px",
                  background: "#91caff",
                  marginRight: "10px",
                }}
                className={style.Reverse}
              />
              <span>0378936624</span>
            </div>

            <div style={{ position: "relative" }}>
              <div
                style={{
                  background: "red",
                  textAlign: "center",
                  borderRadius: "50%",
                  width: 20,
                  height: 24,
                  position: "absolute",
                  top: -14,
                  right: -8,
                }}
              >
                {tours.length}
              </div>
              <Link to="/CartItem">
                <FontAwesomeIcon
                  style={{ color: "white" }}
                  icon={faCartShopping}
                  size="2xl"
                />
              </Link>
            </div>
          </div>
        </div>
      </div>
    </div>
  )
}
